import { useState, useEffect } from "react";

export const Test = () => {
  const [test, setTest] = useState("initial");
  
  useEffect(() => {
    try {
      fetch("http://localhost:3000/api", {
        method: "GET",
      })
        .then((res) => console.log(res))
        .then((data) => setTest(data));
    } catch (error) {
      console.log("error =>", error);
    }
    console.log(test)
  }, []);

  return <h1>Test</h1>;
};
